import React from "react";

const tasks = [
  {
    id: 1,
    text: "Doctor ap",
    day: "sunday",
    reminder: true,
  },
  {
    id: 2,
    text: "lecture ap",
    day: "monday",
    reminder: false,
  },
];

const Tasks = () => {
  return (
    <>
      {tasks.map((task) => (
        <h3>{task.text}</h3>
      ))}
    </>
  );
};

export default Tasks;
